import React from "react";
import SidenavPro from "../component/Sidebar/SidenavPro";
import Box from '@mui/material/Box';

export default function Homepro(){
    return(
        <>
        <Box sx={{display: "flex"}}>
            <SidenavPro />
            <h1>Home</h1>
        </Box>
        </>
        
    )
}
